import React from 'react';
import { NextPage, NextPageContext } from 'next';
import styled from 'styled-components';

import { EpubParser } from '@ridi/epub-parser';

// import Viewer from '../components/viewer/Viewer';

const Test = styled.div`
  background-color: black;
  color: white;
`;

const Home = () => (
  <Test>
    Home
  </Test>
);

Home.getInitialProps = (context: NextPageContext) => {
  try {
    const { req } = context;
    if (req) {
      console.log('Called');

      const parser = new EpubParser('public/pg61611-images.epub');
      parser.parse().then((book) => {
        parser.readItems(book.spines).then((results) => {
          console.log('Res');
        });
      });
    }
  } catch (error) {
    console.log('Error', error);
  }

  return {};
};

export default Home;
